### YamlMime:QSharpType
uid: microsoft.quantum.core.rangeend
name: RangeEnd
type: function
namespace: microsoft.quantum.core
summary: Devolve o valor final definido da gama dada, que não é necessariamente o último elemento na sequência.
remarks: >-
  O primeiro elemento de uma expressão de alcance é `start` , o seu segundo elemento é , terceiro elemento é , `start+step` `start+step+step` etc., até `end` ser passado.


  Note-se que o valor final definido de uma gama pode diferir do último elemento na sequência especificada pela gama; por exemplo, num intervalo de 0 .. 2 .. 5 o último elemento é 4, mas o valor final é 5.
syntax: 'function RangeEnd (range : Range) : Int'
input:
  content: '(range : Range)'
  types:
  - name: range
    isPrimitive: true
    uid: Range
output:
  content: Int
  types:
  - summary: O valor final definido da gama dada.
    isPrimitive: true
    uid: Int
